import React from 'react'
import {SearchOutlined, Notifications} from '@material-ui/icons'

const CardMovie = () => {
  return (
    <div className="container-CardMovie">
      <h1>Card</h1>
      <style jsx>{`
       .container-CardMovie {
            display: flex;
            flex-direction:column;
       }
        .icon-header {
            font-size:25px;
            font-color:#5a5a5a;
        }
        .search {
            margin-right:50px;
        }
      `}</style>
    </div>
  )
}
export default CardMovie
